import React from "react";
import { connect } from "react-redux";
import "./style.css";

class Summary extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    console.log("Summary: ", this.props.FinishEnvironmentReducer);
    return (
      <div className="Summary-main">
        <div className="top-Summary">
          <h2 className="Summmary-heading">Summary</h2>
          <div></div>
        </div>
        <div className="Summmary-content"></div>
        <div class="cards-list">

  <div class="card 1">
    <div class="card_image"> <img src="https://i.redd.it/b3esnz5ra34y.jpg" /> </div>
    <div class="card_title title-white">
      <p>Card Title</p>
    </div>
  </div>

    <div class="card 2">
    <div class="card_image">
      <img src="https://cdn.blackmilkclothing.com/media/wysiwyg/Wallpapers/PhoneWallpapers_FloralCoral.jpg" />
      </div>
    <div class="card_title title-white">
      <p>Card Title</p>
    </div>
  </div>

  <div class="card 3">
    <div class="card_image">
      <img src="https://media.giphy.com/media/10SvWCbt1ytWCc/giphy.gif" />
    </div>
    <div class="card_title">
      <p>Card Title</p>
    </div>
  </div>

    <div class="card 4">
    <div class="card_image">
      <img src="https://media.giphy.com/media/LwIyvaNcnzsD6/giphy.gif" />
      </div>
    <div class="card_title title-black">
      <p>Card Title</p>
    </div>
    </div>

  </div>

        <div className="bottom-Summary "></div>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  FinishEnvironmentReducer: state.FinishEnvironmentReducer
});

const mapDispatchToProps = dispatch => {
  return {};
};
export default connect(mapStateToProps, mapDispatchToProps)(Summary);
